css:
.gomodifytags {
  font-size: 11px;
}
.gomodifytags label {
  font-size: 13.75px;
  padding-right: 10px;
}
.gomodifytags .go-tags-flex-container {
  display: flex;
  flex-direction: row;
  flex-wrap: nowrap;
  justify-content: flex-start;
  align-content: stretch;
  align-items: center;
  vertical-align: middle;
}
.gomodifytags .go-tags-flex-container button {
  order: 0;
  flex: 0 1 auto;
  align-self: auto;
  margin-bottom: 10px;
}
.gomodifytags .go-tags-flex-container div {
  margin-left: 2px;
  margin-right: 2px;
  order: 0;
  flex: 2 1 auto;
  align-self: auto;
}
.gomodifytags .go-tags-list {
  font-size: 16px;
}
.gomodifytags .go-tags-list h3 {
  font-size: 115%;
}
.gomodifytags .btn {
  margin-right: 5px;
  margin-left: 5px;
}
.gomodifytags .case-radio-buttons .input-label {
  padding-right: 10px;
  padding-bottom: 10px;
}
.gomodifytags atom-text-editor[mini].invalid-input-value {
  border-color: #ff5757;
  box-shadow: 0 0 0 1px #ff5757;
  background-color: rgba(127, 43, 43, 0.28);
}
.gomodifytags atom-text-editor[mini].invalid-input-value .selection .region {
  background-color: rgba(229, 78, 78, 0.6);
}
.gomodifytags atom-text-editor[mini].invalid-input-value .cursor {
  border-color: #ff5757;
}
